INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (100,'HTTP_CONTINUE','The client should continue with its request. This interim response is used to inform the client that the initial part of the request has been received and has not yet been rejected by the server.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (101,'HTTP_SWITCHING_PROTOCOLS','The server understands and is willing to comply with the client''s request, via the Upgrade message header field, for a change in the application protocol being used on this connection. The server will switch protocols to those defined by the response''s Upgrade header field immediately after the empty line which terminates the 101 response.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (200,'HTTP_OK','The request has succeeded. The information returned with the response is dependent on the method used in the request');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (201,'HTTP_CREATED CONSTANT','The request has been fulfilled and resulted in a new resource being created.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (202,'HTTP_ACCEPTED','The request has been accepted for processing, but the processing has not been completed. The request might or might not eventually be acted upon, as it might be disallowed when processing actually takes place.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (203,'HTTP_NON_AUTHORITATIVE_INFO','The returned metainformation in the entity-header is not the definitive set as available from the origin server, but is gathered from a local or a third-party copy.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (204,'HTTP_NO_CONTENT','The server has fulfilled the request but does not need to return an entity-body, and might want to return updated metainformation.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (205,'HTTP_RESET_CONTENT','The server has fulfilled the request and the user agent should reset the document view which caused the request to be sent. The response must not include an entity.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (206,'HTTP_PARTIAL_CONTENT','The server has fulfilled the partial GET request for the resource.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (300,'HTTP_MULTIPLE_CHOICES','The requested resource corresponds to any one of a set of representations, each with its own specific location, and agent- driven negotiation information is being provided so that the user (or user agent) can select a preferred representation and redirect its request to that location.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (301,'HTTP_MOVED_PERMANENTLY','The requested resource has been assigned a new permanent URI and any future references to this resource should use one of the returned URIs.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (302,'HTTP_FOUND CONSTANT','The requested resource resides temporarily under a different URI.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (303,'HTTP_SEE_OTHER','The response to the request can be found under a different URI and should be retrieved using a GET method on that resource.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (304,'HTTP_NOT_MODIFIED','If the client has performed a conditional GET request and access is allowed, but the document has not been modified, the server responds with this status code.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (305,'HTTP_USE_PROXY','The requested resource must be accessed through the proxy given by the Location field. The Location field gives the URI of the proxy.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (307,'HTTP_TEMPORARY_REDIRECT','The requested resource resides temporarily under a different URI.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (400,'HTTP_BAD_REQUEST','The request could not be understood by the server due to malformed syntax.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (401,'HTTP_UNAUTHORIZED','The request requires user authentication. The client may repeat the request with a suitable Authorization header field. If the request already included Authorization credentials, then the 401 response indicates that authorization has been refused for those credentials.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (402,'HTTP_PAYMENT_REQUIRED','This code is reserved for future use.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (403,'HTTP_FORBIDDEN','The server understood the request, but is refusing to fulfill it.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (404,'HTTP_NOT_FOUND','The server has not found anything matching the Request-URI.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (406,'HTTP_NOT_ACCEPTABLE','The resource identified by the request is only capable of generating response entities which have content characteristics not acceptable according to the accept headers sent in the request.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (407,'HTTP_PROXY_AUTH_REQUIRED','This code is similar to 401 (Unauthorized), but indicates that the client must first authenticate itself with the proxy.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (408,'HTTP_REQUEST_TIME_OUT','The client did not produce a request within the time that the server was prepared to wait.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (409,'HTTP_CONFLICT','The request could not be completed due to a conflict with the current state of the resource.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (410,'HTTP_GONE','The requested resource is no longer available at the server and no forwarding address is known.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (411,'HTTP_LENGTH_REQUIRED','The server refuses to accept the request without a defined Content-Length.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (412,'HTTP_PRECONDITION_FAILED','The precondition given in one or more of the request-header fields evaluated to false when it was tested on the server.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (413,'HTTP_REQUEST_ENTITY_TOO_LARGE CONSTANT','The server is refusing to process a request because the request entity is larger than the server is willing or able to process.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (414,'HTTP_REQUEST_URI_TOO_LARGE','The server is refusing to service the request because the Request-URI is longer than the server is willing to interpret.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (415,'HTTP_UNSUPPORTED_MEDIA_TYPE','The server is refusing to service the request because the entity of the request is in a format not supported by the requested resource for the requested method.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (416,'HTTP_REQ_RANGE_NOT_SATISFIABLE','A server returns a response with this status code if a request included a Range request-header field, and none of the range-specifier values in this field overlap the current extent of the selected resource, and the request did not include an If-Range request-header field.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (417,'HTTP_EXPECTATION_FAILED','The expectation given in an Expect request-header field could not be met by this server, or, if the server is a proxy, the server has unambiguous evidence that the request could not be met by the next-hop server.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (500,'HTTP_INTERNAL_SERVER_ERROR','Internal Server Error.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (501,'HTTP_NOT_IMPLEMENTED','The server does not support the functionality required to fulfill the request.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (502,'HTTP_BAD_GATEWAY','The server, while acting as a gateway or proxy, received an invalid response from the upstream server it accessed in attempting to fulfill the request');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (503,'HTTP_SERVICE_UNAVAILABLE','The server is currently unable to handle the request due to a temporary overloading or maintenance of the server.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (504,'HTTP_GATEWAY_TIME_OUT','The server, while acting as a gateway or proxy, did not receive a timely response from the upstream server specified by the URI (for example, HTTP, FTP, LDAP) or some other auxiliary server (for example, DNS) it needed to access in attempting to complete the request.');
INSERT INTO WS_STATUS (status_code,nombre,descripcion) VALUES (505,'HTTP_VERSION_NOT_SUPPORTED','The server does not support, or refuses to support, the HTTP protocol version that was used in the request message.');
